import systemPrompt from './promptTemplate.md?raw';

const SYSTEM_PROMPT = systemPrompt
const USER_PROMPT = `
Generate YAML definition file from screenshots of a paper form using the schema defined by SurveyJS.
`
const EXAMPLE_IMG_URL =
  'data:image/png;base64,'

export function generatePrompt(pages, detailLevelHigh, imageList, pdfText) {
  let userPrompt =
    USER_PROMPT +
    `\nIMPORTANT: The PDF file has ${pages} page${
      pages <= 1 ? '' : 's'
    }, make sure to inference all of them.`
  let userContentsList = [
    {
      type: 'image_url',
      image_url: { url: EXAMPLE_IMG_URL, detail: 'low' }
    }
  ]
  for (let index in imageList) {
    userContentsList.push({
      type: 'image_url',
      image_url: {
        url: imageList[index],
        detail: detailLevelHigh ? 'high' : 'low'
      }
    })
  }
  userContentsList.push({
    type: 'text',
    text: userPrompt
  })
  return [
    {
      role: 'system',
      content: SYSTEM_PROMPT.replace('{{target_txt}}', pdfText)
    },
    {
      role: 'user',
      content: userContentsList
    }
  ]
}
